import { Button, ButtonGroup, TableCell } from "@mui/material";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import RemoveRedEyeIcon from "@mui/icons-material/RemoveRedEye";
import ModeEditOutlineIcon from "@mui/icons-material/ModeEditOutline";
import DeleteIcon from "@mui/icons-material/Delete";

const Book = (props) => {
  const history = useNavigate();
  const { _id, title, subTitle, price, mrpPrice } = props.products;

  const deleteHandler = async () => {
    await axios
      .delete(`http://localhost:8080/product/${_id}`)
      .then((res) => console.log(res));
    // .then(() => history(""));
  };

  const handleClickOpen = () => {
    setOpen(true);
  };


  return (
    <>
      <TableCell align="center">{title}</TableCell>
      <TableCell align="center">{subTitle}</TableCell>
      <TableCell align="center">{price}</TableCell>
      <TableCell align="center">{mrpPrice}</TableCell>
      <TableCell  align="center">
        <ButtonGroup
          variant="contained"
          aria-label="outlined primary button group"
        >
          <Button sx={{ borderRadius: 0 }} color="info"  onClick={handleClickOpen}>
            <RemoveRedEyeIcon />
          </Button>
          <Button
            LinkComponent={Link}
            to={`/product/${_id}`}
            sx={{ borderRadius: 0 }}
            color="warning"
          >
            <ModeEditOutlineIcon />
          </Button>
          <Button
            sx={{ borderRadius: 0 }}
            color="error"
            onClick={deleteHandler}
          >
            <DeleteIcon />
          </Button>
        </ButtonGroup>
      </TableCell>
    </>
  );
};
function SimpleDialogDemo() {
  const [open, setOpen] = useStat(false);
  const [selectedValue, setSelectedValue] = React.useState(emails[1]);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = (value) => {
    setOpen(false);
    setSelectedValue(value);
  };

  return (
    <div>
    
      <br />
      <Button variant="outlined" onClick={handleClickOpen}>
        Open simple dialog
      </Button>
      <SimpleDialog
        selectedValue={selectedValue}
        open={open}
        onClose={handleClose}
      />
    </div>
  );
}

export default Book;
